import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import { Carousel, Card, Button } from 'react-bootstrap';

const Landingpage = () => {
    const containerStyle = {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
      };
    
      const headerStyle = {
        backgroundColor: '#3498db',
        padding: '20px',
        color: '#fff',
        textAlign: 'center',
      };
    
      const carouselCaptionStyle = {
        textAlign: 'left',
        left: '5%',
        right: '5%',
        bottom: '20%',
      };
    
      const sectionStyle = {
        padding: '20px',
        textAlign: 'center',
      };
    
      const formStyle = {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
      };
    
      const mapContainerStyle = {
        padding: '20px',
        textAlign: 'center',
      };
    
      const footerStyle = {
        backgroundColor: '#2c3e50',
        padding: '20px',
        color: '#fff',
        textAlign: 'center',
      };
    
      return (
        <><div style={containerStyle}>
              {/* Header */}
              <header style={headerStyle}>
                  <h1>Hospital Management System</h1>
              </header>

              {/* Carousel */}
              <Carousel interval={5000} pause={false} style={{ width: '100%', height: '400px' }}>
                  {/* Slide 1 */}
                  <Carousel.Item>
                      <img
                          className="d-block w-100"
                          src="https://www.missouripartnership.com/wp-content/uploads/2018/01/iStock-695349930-scaled.jpg"
                          alt="First slide"
                          style={{ width: '100%', height: '100%' }} />
                      <Carousel.Caption style={carouselCaptionStyle}>
                          <h1>Welcome to Clinical Automation System</h1>
                          <p>Your trusted partner in healthcare management</p>
                      </Carousel.Caption>
                  </Carousel.Item>

                  {/* Slide 2 */}
                  <Carousel.Item>
                      <img
                          className="d-block w-100"
                          src="https://www.expresshealthcaremgmt.com/wp-content/uploads/2023/07/mfrack_healthcare_46599581-8752-4e1e-9c37-9551a6d4a9ed.jpeg"
                          alt="Second slide"
                          style={{ width: '100%', height: '100%' }} />
                      <Carousel.Caption style={{ ...carouselCaptionStyle, bottom: '10%' }}>
                          <h1>Welcome to Clinical Automation System</h1>
                          <p>We care for your Health</p>
                      </Carousel.Caption>
                  </Carousel.Item>

                  {/* Add more Carousel.Items for additional slides */}
                  {/* Example: */}
                  <Carousel.Item>
                      <img
                          className="d-block w-100"
                          src="https://example.com/third-image.jpg"
                          alt="Third slide"
                          style={{ width: '100%', height: '100%' }} />
                      <Carousel.Caption style={carouselCaptionStyle}>
                          <h1>Welcome to Clinical Automation System</h1>
                          <p>Additional caption for the third slide</p>
                      </Carousel.Caption>
                  </Carousel.Item>
              </Carousel>
          </div><div>
                  {/* Services */}
                  <section style={sectionStyle}>
                      <h2>Our Services</h2>
                      <div className="card-deck">
                          {/* Card 1 */}
                          <Card style={{ width: '18rem', margin: '10px' }}>
                              <Card.Img variant="top" src="service1.jpg" />
                              <Card.Body>
                                  <Card.Title>Service 1</Card.Title>
                                  <Card.Text>Service 1 description.</Card.Text>
                              </Card.Body>
                          </Card>
                          {/* Repeat the Card structure for the remaining 6 services */}
                      </div>
                  </section>

                  {/* About Us */}
                  <section style={{ ...sectionStyle, backgroundColor: '#ecf0f1' }}>
                      <h2>About Us</h2>
                      <p>Welcome to our Hospital Management System. We are dedicated to providing quality healthcare services to our community.</p>
                  </section>

                  {/* Appointment Booking */}
                  <section style={sectionStyle}>
                      <h2>Book an Appointment</h2>
                      <form style={formStyle}>
                          {/* Add form fields for appointment booking */}
                          <label style={{ margin: '5px' }}>Name:</label>
                          <input type="text" placeholder="Your Name" style={{ width: '300px', margin: '5px' }} />

                          <label style={{ margin: '5px' }}>Email:</label>
                          <input type="email" placeholder="Your Email" style={{ width: '300px', margin: '5px' }} />

                          <label style={{ margin: '5px' }}>Preferred Date:</label>
                          <input type="date" style={{ width: '300px', margin: '5px' }} />

                          <Button variant="primary" type="submit" style={{ width: '150px', margin: '10px' }}>
                              Book Now
                          </Button>
                      </form>
                  </section>

                  {/* Location Map */}
                  <div style={mapContainerStyle}>
                      <h2>Location Map</h2>
                      {/* Add your map component or iframe here */}
                      {/* Example: */}
                      <iframe
                          title="Hospital Location"
                          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d22403.57364665361!2d-74.00594110269566!3d40.71277665161806!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x0!2zNDDCsDQ1JzM4LjAiTiA3NMKwMjInMDQuNCJX!5e0!3m2!1sen!2sus!4v1584399207509!5m2!1sen!2sus"
                          width="600"
                          height="450"
                          frameBorder="0"
                          style={{ border: '0', width: '100%' }}
                          allowFullScreen=""
                          aria-hidden="false"
                          tabIndex="0"
                      ></iframe>
                  </div>

                  {/* Contact Us */}
                  <section style={{ ...sectionStyle, backgroundColor: '#ecf0f1' }}>
                      <h2>Contact Us</h2>
                      <p>For inquiries, please contact us at <strong>info@examplehospital.com</strong>.</p>
                  </section>

                  {/* Footer */}
                  <footer style={footerStyle}>
                      <p>&copy; 2023 Hospital Management System</p>
                  </footer>
              </div></>
      );
    };
    
export default Landingpage;
